const Footer_Journal = () => {
  const benefits = ["تخفیف ها", "رویداد ها", "بروزرسانی ها"];

  return (
    <div className="absolute left-0 right-0 md:w-[50vw] w-[70vw] bg px-12 py-12">
      <div>
        <h4 className="title">عضویت در ماهنامه‌ی امپراتوری</h4>
        <div className="flex">
          <p>برای آگاهی از:</p>
          <ul className="flex items-center gap-x-2">
            {benefits.map((item, index) => {
              return (
                <li key={index}>
                  <i className="fa-solid fa-check"></i>
                  {item}
                </li>
              );
            })}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Footer_Journal;
